PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE events (id INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, old_status BOOLEAN DEFAULT NULL, new_status BOOLEAN DEFAULT NULL, timestamp DATETIME NOT NULL, type VARCHAR(16) NOT NULL COLLATE BINARY, artisan_name VARCHAR(256) NOT NULL COLLATE BINARY, checked_url VARCHAR(1024) NOT NULL COLLATE BINARY, open_match CLOB NOT NULL COLLATE BINARY, closed_match CLOB NOT NULL COLLATE BINARY, description CLOB NOT NULL, new_makers_count INTEGER NOT NULL, updated_makers_count INTEGER NOT NULL, reported_updated_makers_count INTEGER NOT NULL, git_commits VARCHAR(256) DEFAULT '' NOT NULL);
COMMIT;
